import React, { useEffect, useState } from 'react';
import { 
  Container, Typography, Grid, Paper, Box, AppBar, Toolbar, CssBaseline, Button, Drawer, List, 
  ListItem, ListItemIcon, ListItemText, TextField 
} from '@mui/material';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { 
  Dashboard as DashboardIcon, ShoppingCart as ShoppingCartIcon, Settings as SettingsIcon, 
  Calculate as CalculateIcon, ExitToApp as ExitToAppIcon 
} from '@mui/icons-material';
import { BrowserRouter, Link, Route, Routes, useNavigate } from 'react-router-dom';
import FeeCalculatorPage from './FeeCalculator';
import Settings from './Settings';
import Logout from './Logout';
import UserDashboard from './UserDashboard';
import ProductCard from '../components/ProductCard';

const theme = createTheme({
  palette: {
    mode: 'dark',
    primary: { main: '#90caf9' },
    secondary: { main: '#f48fb1' },
    background: { default: '#1c1c1c', paper: '#2c2c2c' },
    text: { primary: '#ffffff' },
  },
});

function Products() {
  const [products, setProducts] = useState([]);
  const [query, setQuery] = useState("");
  const navigate = useNavigate();

  // Fetch initial products
  useEffect(() => {
    fetchProducts();
  }, []);

  // Function to fetch all products
  const fetchProducts = async () => {
    try {
      const response = await fetch('http://localhost:8000/products?skip=0&limit=10', {
        credentials: 'include',
        headers: {
          'Authorization': 'Basic ' + btoa('juggy:Idus1234@@'),
          'Content-Type': 'application/json',
        },
      });

      if (!response.ok) {
        throw new Error(`Error: ${response.status}`);
      }

      const data = await response.json();
      setProducts(data);
    } catch (error) {
      console.error('Fetch error:', error);
    }
  };

  // Function to fetch search results
  const handleSearch = async () => {
    if (!query.trim()) {
      fetchProducts(); // Reload all products if search is cleared
      return;
    }

    try {
      const response = await fetch(`http://localhost:8000/search?query=${query}`, {
        credentials: 'include',
        headers: { 'Content-Type': 'application/json' },
      });

      if (!response.ok) {
        throw new Error(`Search Error: ${response.status}`);
      }

      const data = await response.json();
      setProducts(data);
    } catch (error) {
      console.error('Search error:', error);
    }
  };

  // Listen for Enter key press
  const handleKeyDown = (e) => {
    if (e.key === 'Enter') {
      e.preventDefault();
      handleSearch();
    }
  };

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <AppBar position="fixed">
        <Toolbar>
          <Typography variant="h6" sx={{ flexGrow: 1 }}>FlipVault</Typography>
          <Button color="inherit" component={Link} to="/login">Log in</Button>
        </Toolbar>
      </AppBar>
      <Drawer variant="permanent" sx={{ width: 240, flexShrink: 0 }}>
        <Toolbar />
        <List>
          <ListItem button component={Link} to="/user-dashboard">
            <ListItemIcon><DashboardIcon /></ListItemIcon>
            <ListItemText primary="Dashboard" />
          </ListItem>
          <ListItem button component={Link} to="/products">
            <ListItemIcon><ShoppingCartIcon /></ListItemIcon>
            <ListItemText primary="Products" />
          </ListItem>
          <ListItem button component={Link} to="/fee-calculator">
            <ListItemIcon><CalculateIcon /></ListItemIcon>
            <ListItemText primary="Fee Calculator" />
          </ListItem>
          <ListItem button component={Link} to="/settings">
            <ListItemIcon><SettingsIcon /></ListItemIcon>
            <ListItemText primary="Settings" />
          </ListItem>
          <ListItem button component={Link} to="/logout">
            <ListItemIcon><ExitToAppIcon /></ListItemIcon>
            <ListItemText primary="Log Out" />
          </ListItem>
        </List>
      </Drawer>
      <Box component="main" sx={{ flexGrow: 1, p: 3, ml: 240 }}>
        <Toolbar />
        <Routes>
          <Route path="/fee-calculator" element={<FeeCalculatorPage />} />
          <Route path="/settings" element={<Settings />} />
          <Route path="/logout" element={<Logout />} />
          <Route path="/user-dashboard" element={<UserDashboard />} />
          <Route path="/products" element={<Products />} />
          <Route path="/productcard/:productId" element={<ProductCard />} />
        </Routes>
      </Box>

      {/* Search Box */}
      <Container maxWidth="sm" sx={{ mt: 2, backgroundColor: '#333', color: '#fff', p: 4, borderRadius: 2 }}>
        <Typography variant="h4" sx={{ textAlign: 'center', mb: 2 }}>Products</Typography>
        <Paper sx={{ p: 2, display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
          <TextField
            fullWidth
            variant="outlined"
            placeholder="Search products"
            value={query}
            onChange={(e) => setQuery(e.target.value)}
            onKeyDown={handleKeyDown} // Trigger search on Enter
            sx={{ mb: 2 }}
          />
          <Button variant="contained" color="primary" onClick={handleSearch}>Search</Button>
        </Paper>
      </Container>

      {/* Product List */}
      <Container sx={{ mt: 4 }}>
        <Grid container spacing={4}>
          {products.length > 0 ? (
            products.map((product) => (
              <Grid item key={product.id} xs={12} sm={6} md={4}>
                <Paper sx={{ p: 2, cursor: 'pointer' }} onClick={() => navigate(`/productcard/${product.id}`)}>
                  <img src={product.image_url} alt={product.name} style={{ width: '100%', borderRadius: '4px' }} />
                  <Typography variant="h6" sx={{ mt: 2 }}>{product.name}</Typography>
                </Paper>
              </Grid>
            ))
          ) : (
            <Typography variant="h6" sx={{ textAlign: 'center', width: '100%', mt: 2 }}>
              No products found.
            </Typography>
          )}
        </Grid>
      </Container>
    </ThemeProvider>
  );
}

export default Products;
